@beppepalmieri ‘Cca e quann t’aggio voluto bbene assaje’!!
In napoletano ‘volere bene’ indica comprensione, sintonia, uno stato d’animo di condivisione e empatia. In napoletano ‘te vojo bbene’ è per chi ama, chi ha passione, per se stesso, per la vita, per il proprio lavoro.
‘Fare agli altri quelli che vorresti venga fatto a te’ è l’idea che mi ritorna costantemente in testa dopo il pranzo all’Osteria Francescana. Cameriere, anfitrione, psicologo, un po’ attore, un po’ mago...come dici tu : camerieri non si nasce, camerieri si diventa’. #osteriafrancescana #waiter #beppepalmieri
